uid: azure.mgmt.datamigration.models.NonSqlMigrationTaskOutput
name: NonSqlMigrationTaskOutput
fullName: azure.mgmt.datamigration.models.NonSqlMigrationTaskOutput
module: azure.mgmt.datamigration.models
inheritances:
- msrest.serialization.Model
summary: 'Base class for non sql migration task output.


  Variables are only populated by the server, and will be ignored when sending a request.'
constructor:
  syntax: NonSqlMigrationTaskOutput(**kwargs)
variables:
- description: Result identifier.
  name: id
  types:
  - <xref:str>
- description: Migration start time.
  name: started_on
  types:
  - <xref:datetime.datetime>
- description: Migration end time.
  name: ended_on
  types:
  - <xref:datetime.datetime>
- description: 'Current state of migration. Possible values include: "Default", "Connecting",

    "SourceAndTargetSelected", "SelectLogins", "Configured", "Running", "Error", "Stopped",

    "Completed", "CompletedWithWarnings".'
  name: status
  types:
  - <xref:str>
  - <xref:azure.mgmt.datamigration.models.MigrationStatus>
- description: 'Results of the migration. The key contains the table name

    and the value the table result object.'
  name: data_migration_table_results
  types:
  - <xref:str>
- description: Message about the progress of the migration.
  name: progress_message
  types:
  - <xref:str>
- description: Name of source server.
  name: source_server_name
